using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using DemoGit.Domain.Entities;
using DemoGit.Infrastructure.Context.Interfaces;
using DemoGit.Infrastructure.Context.Repositories;
using MongoDB.Driver;

namespace DemoGit.Infrastructure.Context.Seed
{
    public class MongoDbSeed
    {
        private readonly IMongoDatabase _db;

        public MongoDbSeed(string connectionString)
        {
            var client = new MongoClient(connectionString);
            _db = client.GetDatabase("DemoGit");
        }

        public void ResourceSeed()
        {
            var collection = _db.GetCollection<Resource>("Resources");

            if (collection.Find(r => r.FileName == "active_heart_icon.png").FirstOrDefault() is null)
                collection.InsertOne(new Resource { FileName = "active_heart_icon.png", ResourceType = "image", Base64 = "" });

            if (collection.Find(r => r.FileName == "heart_icon.png").FirstOrDefault() is null)
                collection.InsertOne(new Resource { FileName = "heart_icon.png", ResourceType = "image", Base64 = "" });
        }
    }
}